import React, { useContext, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { PalettesContext } from '../PalettesContext';
import PalettePreview from '../components/PalettePreview';

const Palettes = () => {
  const { palettes, getPalettes } = useContext(PalettesContext);

  useEffect(() => {
    console.log(palettes);
  }, [palettes]);

  return (
    <div>
      <h1>Palettes</h1>
      {palettes
        ? palettes.map(palette => <PalettePreview palette={palette} />)
        : ''}
      {/* <Link to='/palettes/2'>2</Link>
      <Link to='/palettes/999'>999</Link> */}
    </div>
  );
};

export default Palettes;
